export const EnfermedadMadre = () => {
    return (
         <div class="form-floating">
            <input type = "text" class="form-control" name = "enfermedad_madre" id="enfermedad_madre"/>
            <label htmlFor= "enfermedad_madre" >
                Enfermedad que padece o padecio
            </label>
        </div>
    )
}
